  const [location, setLocation] = useState<Pos>();
  const date = "02/02/1999";
  // React.useEffect(() => {
  //   navigator.geolocation.getCurrentPosition((pos) => setLocation());
  // }, []);
  return (
    <div className="bg-white rounded-lg w-1/2 m-auto h-4/5 mt-8">
      <p> {location}</p>
      <p> {date} </p>
      <Weather_icons_cloudy />
    </div>
  );
};

export default ActualPos;
